import { Component, Inject } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})


export class RegisterComponent {
    username: string = "";
    password: string = "";
    email: string = "";
    role: string = "";
    tmbd_key: string = "";
    screen: number = 1;

    next_screen() {
      if (this.screen < 3) {
        this.screen += 1;
    }
  }

    prev_screen() {
      if (this.screen > 1) {
        this.screen -= 1;
      }
    }

    submit_form() {
      let data = {username:this.username, 
                  password:this.password, 
                  email:this.email,
                  role:this.role, 
                  tmbd_key:this.tmbd_key};
      console.log(data);
    }

}
